function username(){var b=$("#form-private");showerrors(b);b.validate({rules:{username:{required:true,uniqueuser:true}},messages:{username:{required:"Por favor, escriba el usuario.",}}});
if(b.valid()){var c=b.attr("data-action");var a=sendformajax(c,"usuario",b);switch(a[0]){case true:redirectpage("mi-perfil");break;case false:redirectpage("modificar-usuario");
break;}}else{return false;}return false;}$(document).ready(function(){$("form button").click(function(){username();});});